      string: "<?xml version=\"1.0\"?>\r\n<package xmlns=\"http://schemas.microsoft.com/packaging/2012/06/nuspec.xsd\">\r\n
        \ <metadata>\r\n    <id>Octokit</id>\r\n    <version>0.24.0</version>\r\n
        \   <authors>GitHub</authors>\r\n    <owners>GitHub</owners>\r\n    <licenseUrl>https://github.com/octokit/octokit.net/blob/master/LICENSE.txt</licenseUrl>\r\n
        \   <projectUrl>https://github.com/octokit/octokit.net</projectUrl>\r\n    <iconUrl>https://f.cloud.github.com/assets/19977/1441274/160fba8c-41a9-11e3-831d-61d88fa886f4.png</iconUrl>\r\n
        \   <requireLicenseAcceptance>false</requireLicenseAcceptance>\r\n    <description>An
        async-based GitHub API client library for .NET</description>\r\n    <summary>An
        async-based GitHub API client library for .NET</summary>\r\n    <releaseNotes>**Features/Enhancements**\r\n-
        Add `GetAll` method to `OrganizationsClient` - [#1469](https://github.com/octokit/octokit.net/pull/1469)
        via [malamour-work](https://github.com/malamour-work)\r\n- Add missing fields
        to `Repository` class - `HasPages`, `SubscribersCount`, `Size` - [#1473](https://github.com/octokit/octokit.net/pull/1473)
        via [ryangribble](https://github.com/ryangribble)\r\n- Allow base64 content
        for create/update file - [#1488](https://github.com/octokit/octokit.net/pull/1488)
        via [laedit](https://github.com/laedit)\r\n- Add `HtmlUrl` field to `Milestone`
        class - [#1489](https://github.com/octokit/octokit.net/pull/1489) via [StanleyGoldman](https://github.com/StanleyGoldman)\r\n-
        Add support for passing sort options to `IssueCommentsClient.GetAllForRepository()`
        - [#1501](https://github.com/octokit/octokit.net/pull/1501) via [pjc0247](https://github.com/pjc0247)\r\n-
        Rename `PullRequest.Comment` to `PullRequest.ReviewComment` for better accuracy
        - [#1520](https://github.com/octokit/octokit.net/pull/1520) via [bmeverett](https://github.com/bmeverett)\r\n-
        Introduce `AbuseException` - [#1528](https://github.com/octokit/octokit.net/pull/1528)
        via [SeanKilleen](https://github.com/SeanKilleen)\r\n- Add `Id` field to `PullRequest`
        class - [#1537](https://github.com/octokit/octokit.net/pull/1537) via [YunLi1988](https://github.com/YunLi1988)\r\n-
        Unparseable `ApiErrors` should now fall back to better default error messages
        - [#1540](https://github.com/octokit/octokit.net/pull/1540) via [SeanKilleen](https://github.com/SeanKilleen)\r\n\r\n**Fixes**\r\n-
        Fix errors in `ObservableEventsClient` caused by incorrect return types -
        [#1490](https://github.com/octokit/octokit.net/pull/1490) via [StanleyGoldman](https://github.com/StanleyGoldman)\r\n-
        Add missing `SecurityCritical` attribute on `GetObjectData()` overrides -
        [#1493](https://github.com/octokit/octokit.net/pull/1493) via [M-Zuber](https://github.com/M-Zuber)\r\n-
        Fix exceptions in Events API by adding missing event types to `EventInfo`
        enumeration - [#1536](https://github.com/octokit/octokit.net/pull/1536) via
        [lynnfaraday](https://github.com/lynnfaraday)\r\n- Add new AccountType \"Bot\"
        to prevent deserialization errors - [#1541](https://github.com/octokit/octokit.net/pull/1541)
        via [ryangribble](https://github.com/ryangribble)\r\nDocumentation Updates**\r\n-
        Clarify `ApiInfo` rate limiting usage in docs - [#1524](https://github.com/octokit/octokit.net/pull/1524)
        via [SeanKilleen](https://github.com/SeanKilleen)\r\n- Clarify label coloring
        usage in docs - [#1530](https://github.com/octokit/octokit.net/pull/1530)
        via [SeanKilleen](https://github.com/SeanKilleen)\r\n\r\n**Breaking Changes**\r\n-
        Creating and Editing Issues (and PullRequests) using `NewIssue` and `IssueUpdate`
        requests\r\nshould now use the `Assignees` collection rather than the now
        deprecated 'Assignee` field.\r\nBoth fields can't be specified on the same
        request, so any code still using `Assignee` will\r\nneed to explicitly set
        `Assignees` to `null` to avoid Api validation errors.\r\n- `OrganizationsClient.GetAll(string
        user)` has been marked obsolete in favour of\r\n`OrganizationsClient.GetAllForUser(string
        user)`\r\n- `PullRequest.Comment` has been marked obsolete in favour of `PullRequest.ReviewComment`\r\n-
        Several `EventsClient` methods previously returned the incorrect `Activity`
        response class.\r\nThis has been corrected to `IssueEvent` which although
        is now correct could break calling\r\ncode that was written assuming this
        previous incorrect return type.</releaseNotes>\r\n    <copyright>Copyright
        GitHub 2013</copyright>\r\n    <tags>GitHub API Octokit linqpad-samples</tags>\r\n
        \   <dependencies>\r\n      <group>\r\n        <dependency id=\"Microsoft.Net.Http\"
        />\r\n      </group>\r\n      <group targetFramework=\".NETFramework4.5\"
        />\r\n      <group targetFramework=\".NETCore4.5\" />\r\n      <group targetFramework=\".NETPortable0.0-win81+wpa81\"
        />\r\n    </dependencies>\r\n    <frameworkAssemblies>\r\n      <frameworkAssembly
        assemblyName=\"System\" targetFramework=\".NETFramework4.5\" />\r\n      <frameworkAssembly
        assemblyName=\"System.Net.Http\" targetFramework=\".NETFramework4.5, .NETCore4.5\"
        />\r\n    </frameworkAssemblies>\r\n  </metadata>\r\n</package>"
